import React from 'react';
import styled, { keyframes } from 'styled-components';
import { motion } from 'framer-motion';
import { FaTelegram, FaMedium } from 'react-icons/fa';
import { FaXTwitter } from 'react-icons/fa6';
import AnimatedBackground from './components/AnimatedBackground';

// Dark RPG color palette
const brown = '#3e2a13';
const darkBrown = '#1a1208';
const parchment = '#2b2112';
const gold = '#ffd700';
const yellow = '#ffe066';

const AppContainer = styled.div`
  min-height: 100vh;
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: center;
  color: #f8ecd1;
  padding: 2.5rem 1.5rem;
  position: relative;
  font-family: 'Merriweather', serif;
  background: none;
  gap: 2.5rem;

  @media (max-width: 900px) {
    flex-direction: column;
    align-items: center;
    gap: 1.5rem;
    padding: 1.2rem 0.4rem;
  }
`;

const CardColumn = styled.div`
  display: flex;
  flex-direction: column;
  gap: 1.5rem;
  width: 100%;
  max-width: 540px;

  @media (max-width: 900px) {
    max-width: 100vw;
    width: 100vw;
    align-items: center;
    justify-content: center;
  }
`;

const Card = styled(motion.div)`
  background: linear-gradient(135deg, ${parchment} 85%, #3e2a13 100%);
  border-radius: 22px;
  box-shadow: 0 8px 32px 0 rgba(26, 18, 8, 0.24), 0 2px 8px 0 rgba(110,75,35,0.18);
  padding: 2.2rem 1.7rem;
  max-width: 480px;
  width: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  border: 2.5px solid ${gold};
  position: relative;
  font-family: 'Merriweather', serif;
  box-sizing: border-box;

  @media (max-width: 600px) {
    padding: 1.2rem 0.5rem;
    max-width: 98vw;
    min-width: 0;
  }
`;

const MascotCircle = styled(motion.div)`
  width: 140px;
  height: 140px;
  border-radius: 50%;
  overflow: hidden;
  border: 5px solid ${gold};
  box-shadow: 0 0 0 8px rgba(110,75,35,0.16), 0 6px 24px 0 rgba(26, 18, 8, 0.25);
  background: linear-gradient(135deg, #2b2112 70%, ${gold} 100%);
  display: flex;
  align-items: center;
  justify-content: center;
  margin-bottom: 1.2rem;
  position: relative;
  z-index: 2;

  @media (max-width: 600px) {
    width: 94px;
    height: 94px;
    margin-bottom: 0.7rem;
  }
`;

const MascotImg = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
`;

const Title = styled(motion.h1)`
  font-family: 'Merriweather', serif;
  font-size: 2.4rem;
  font-weight: 700;
  color: ${gold};
  margin-bottom: 0.9rem;
  letter-spacing: 1.5px;
  text-shadow: 0 2px 0 #1a1208, 0 0 8px ${gold};
  text-align: center;

  @media (max-width: 600px) {
    font-size: 1.5rem;
    margin-bottom: 0.5rem;
  }
`;

const Description = styled(motion.p)`
  font-size: 1.22rem;
  color: #f8ecd1;
  margin-bottom: 1.2rem;
  text-align: center;
  font-family: 'Merriweather', serif;

  @media (max-width: 600px) {
    font-size: 1rem;
    margin-bottom: 0.7rem;
  }
`;

const QualitiesList = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0 0 0.5rem 0;
  text-align: left;
`;

const Quality = styled.li`
  font-size: 1.16rem;
  color: ${gold};
  margin: 0.25rem 0;
  padding-left: 1.3em;
  position: relative;
  font-family: 'Merriweather', serif;
  &:before {
    content: 'âœ¦';
    color: ${yellow};
    position: absolute;
    left: 0;
    font-size: 1.1em;
    top: 0.02em;
  }

  @media (max-width: 600px) {
    font-size: 0.95rem;
  }
`;

const AddressText = styled.div`
  font-family: 'Merriweather', serif;
  font-size: 1.18rem;
  background: linear-gradient(90deg, #2b2112 70%, #3e2a13 100%);
  color: ${gold};
  padding: 0.95rem 1.4rem;
  border-radius: 10px;
  margin-top: 0.5rem;
  border: 2px solid ${gold};
  word-break: break-all;
  box-shadow: 0 2px 8px 0 rgba(110,75,35,0.12);

  @media (max-width: 600px) {
    font-size: 0.98rem;
    padding: 0.6rem 0.6rem;
  }
`;

const BuyButton = styled(motion.button)`
  padding: 1.15rem 2.8rem;
  font-size: 1.26rem;
  background: linear-gradient(90deg, ${gold} 0%, ${brown} 100%);
  border: 2.5px solid ${gold};
  border-radius: 22px;
